            <p id='text' className='text-light'>Designed by Abduvakhob | Copiright 2023 </p>
                    <div className='d-flex bg-warning'>
                    <Link to={'https://instagram.com/abdurakhhmonov__a'}> <i id='icon' class="bi bi-instagram text-light"></i></Link>
