                    <div className='d-flex bg-warning'>
                    <Link to={'https://instagram.com/abdurakhhmonov__a'}> <i id='icon' class="bi bi-instagram text-light"></i></Link>
                    <Link to={'https://t.me/abduvakhob_node'}> <i id='icon' class="bi bi-telegram text-light"></i></Link>
                    <Link to={'https://github.com/AbduvakhobJS'}> <i id='icon' class="bi bi-github text-light"></i></Link>
                    </div>
                    </div>
                    
                    {/* <Link to={'https://instagram.com/abdurakhhmonov__a'}> <i id='icon' class="bi bi-instagram text-light"></i></Link>
                    <Link to={'https://t.me/abduvakhob_node'}> <i id='icont' class="bi bi-telegram text-light"></i></Link> */}
                    
                    
                    {/* <Link to={'https://github.com/AbduvakhobJS'}> <i id='icong' class="bi bi-github text-light"></i></Link> */}
                    
                </div>
            </nav>
        </footer>

    )
}




export default Footer;
